// ==UserScript==
// @name         Fix Roblox Icon
// @namespace    http://thelmgn.com/
// @version      0.1
// @description  Use a red favicon on Roblox.com
// @author       theLMGN
// @match        https://www.roblox.com/*
// @grant        none
// ==/UserScript==

(function() {
    'use strict';
    console.log("Loading icon")
    document.querySelector("head > link[rel=icon]").href = "data:image/vnd.microsoft.icon;base64,"
    setInterval(function() {
      for (var elem of document.querySelectorAll(".social-links .type-img")) {
          elem.style.backgroundImage = "url(data:image/svg+xml;base64,)"
      }
    })
})();